  \"Database of Nucleon-Nucleon Scattering Cross Sections by Stochastic Simulation
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 10,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T01:16:08.830679\",\n\t\"name\":
  \"database-of-nucleon-nucleon-scattering-cross-sections-by-stochastic-simulation-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A database of nucleon-nucleon elastic differential
  and total cross sections will be generated by stochastic simulation of the quantum
  Liouville equation in the Wigner representation, incorporating innovations of: (1)
  antisymmetrization effects of spin ? nucleons in phase space; (2) the first order
  quantum corrections as a stochastic process for two-nucleon dynamics; and (3) a
  linked list algorithm to streamline and speed computing. Phase I will produce a
  prototype 4-dimensional phase space simulation of one dimensional spatial scattering,
  which will be extended in Phase II to three dimensional spatial scattering with
  a full 12-dimensional phase space model. Significance includes design of radiation
  shielding materials for manned NASA missions into deep space, where galactic cosmic
  rays pose a serious health hazard. Computer codes simulating nuclear transport through
  materials, with associated input databases of interaction cross sections, enable
  radiation risk assessment of shielding materials. The proposed database of nucleon
  cross sections forms a subset of the input database. The simulation may potentially
  be extended to generate databases for nuclear elastic, inelastic, and fragmentation
  cross sections. Commercial applications include radiation protection for humans
  on earth under hazardous conditions. The simulation also has applications to nanotechnology
  and quantum information technologies.\",\n\t\"license_title\": \"U.S. Government
